description:
We're The Deegans! Brian Deegan, 14 time X Games medalist and co founder of the Metal Mulisha, continues his career in action sports along side his wife Marissa Deegan and their kids Hailie, Haiden, and Hudson. Hailie is currently pursuing her NASCAR career. Haiden recently signed his factory motocross ride with Star Yamaha. Hudson continues to send it and go big every day! Make sure to subscribe and turn on those notifications to never miss a moment of our journey!

